import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const [displayText, setDisplayText] = useState('');
  const fullText = "Multi-talented creator and developer with expertise in software development, content creation, gaming, and design. Passionate about building innovative digital solutions while entertaining and educating audiences. Ready to bring creativity and technical skills to exciting projects.";

  useEffect(() => {
    let index = 0;
    const timer = setInterval(() => {
      if (index < fullText.length) {
        setDisplayText(fullText.slice(0, index + 1));
        index++;
      } else {
        clearInterval(timer);
      }
    }, 50);

    return () => clearInterval(timer);
  }, []);

  return (
    <section className="py-32 px-4 relative overflow-hidden">
      {/* Gaming Matrix Background Elements */}
      <div className="absolute inset-0">
        {[...Array(20)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute rounded-full opacity-20"
            style={{
              width: `${Math.random() * 150 + 50}px`,
              height: `${Math.random() * 150 + 50}px`,
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              background: `radial-gradient(circle, ${[
                'rgba(0, 255, 255, 0.3)',
                'rgba(0, 128, 255, 0.3)',
                'rgba(64, 64, 255, 0.3)',
                'rgba(128, 0, 255, 0.3)'
              ][Math.floor(Math.random() * 4)]} 0%, transparent 70%)`,
              filter: 'blur(2px)'
            }}
            animate={{
              y: [-30, 30, -30],
              x: [-20, 20, -20],
              scale: [1, 1.2, 1],
              rotate: [0, 180, 360],
            }}
            transition={{
              duration: 10 + Math.random() * 5,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          />
        ))}
      </div>

      <div className="max-w-6xl mx-auto relative z-10">
        <motion.h2 
          className="text-6xl md:text-8xl font-black text-center mb-20 gaming-title"
          initial={{ opacity: 0, y: 100, rotateX: -90 }}
          whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
          transition={{ duration: 1.5, ease: "easeOut" }}
          viewport={{ once: true }}
        >
          <span className="text-gaming-gradient hover-glow">
            About Me
          </span>
        </motion.h2>

        <div className="max-w-4xl mx-auto text-center">
          {/* Gaming Typing Animation */}
          <motion.div
            className="gaming-card hover-gaming p-8 rounded-2xl backdrop-blur-xl transform-gpu animate-gaming-pulse mb-8"
            whileHover={{ 
              scale: 1.05,
              rotateY: 8,
              boxShadow: '0 30px 80px rgba(0, 255, 255, 0.4), 0 0 100px rgba(0, 128, 255, 0.3)'
            }}
          >
            <div className="text-2xl leading-relaxed min-h-[150px] gaming-text">
              <span className="hover-glow" style={{
                color: '#E0E6ED',
                fontWeight: '500',
                textShadow: '0 2px 4px rgba(0, 0, 0, 0.3)'
              }}>{displayText}</span>
              <motion.span
                className="inline-block w-1 h-8 ml-2"
                style={{ backgroundColor: '#00ffff' }}
                animate={{ opacity: [1, 0, 1] }}
                transition={{ duration: 1, repeat: Infinity }}
              />
            </div>
          </motion.div>

          {/* Gaming Key Points */}
          <div className="grid md:grid-cols-2 gap-6 mb-8">
            {[
              { icon: "ðŸŽ¯", text: "Multi-Platform Developer: Web, Mobile & Desktop Apps", color: "cyan" },
              { icon: "ðŸŽ®", text: "Gaming Content Creator & YouTuber with 10K+ Subscribers", color: "blue" },
              { icon: "ðŸŽ¨", text: "UI/UX Designer: Creating Beautiful Digital Experiences", color: "purple" },
              { icon: "ðŸš€", text: "Software Developer: Full-Stack Development Expertise", color: "indigo" }
            ].map((item, index) => (
              <motion.div
                key={index}
                className="gaming-card hover-gaming p-6 rounded-xl backdrop-blur-xl transform-gpu animate-gaming-pulse"
                initial={{ opacity: 0, y: 50, rotateX: -30 }}
                whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
                transition={{ delay: index * 0.2, duration: 0.8 }}
                viewport={{ once: true }}
                whileHover={{ 
                  scale: 1.08, 
                  rotateY: 12,
                  boxShadow: `0 25px 50px rgba(${item.color === 'cyan' ? '0, 255, 255' : item.color === 'blue' ? '0, 128, 255' : item.color === 'purple' ? '128, 0, 255' : '64, 64, 255'}, 0.5)`
                }}
              >
                <div className="flex items-center space-x-6">
                  <motion.span 
                    className="text-5xl"
                    whileHover={{ scale: 1.4, rotate: 15 }}
                    transition={{ duration: 0.3 }}
                  >
                    {item.icon}
                  </motion.span>
                  <span className="hover-glow" style={{
                    color: item.color === 'cyan' ? '#00ffff' : 
                           item.color === 'blue' ? '#0080ff' : 
                           item.color === 'purple' ? '#8000ff' : '#4040ff',
                    fontWeight: '600',
                    textShadow: '0 2px 4px rgba(0, 0, 0, 0.3)'
                  }}>{item.text}</span>
                </div>
              </motion.div>
            ))}
          </div>

          {/* Gaming Goal Statement */}
          <motion.div
            className="gaming-card hover-gaming p-8 rounded-2xl backdrop-blur-xl transform-gpu animate-gaming-pulse"
            initial={{ opacity: 0, scale: 0.8, rotateY: -30 }}
            whileInView={{ opacity: 1, scale: 1, rotateY: 0 }}
            transition={{ delay: 1, duration: 1.2 }}
            viewport={{ once: true }}
            whileHover={{
              scale: 1.06,
              rotateY: 8,
              boxShadow: '0 40px 100px rgba(0, 255, 255, 0.5), 0 0 120px rgba(0, 128, 255, 0.4)'
            }}
          >
            <h3 className="text-gaming-gradient hover-glow text-3xl font-black mb-6">Career Objective</h3>
            <p className="gaming-text hover-glow text-xl leading-relaxed">
              Passionate multi-disciplinary creator combining development, design, gaming, and content creation. 
              Specialized in building innovative digital solutions while entertaining and educating audiences 
              through YouTube content. Ready to bring creativity, technical expertise, and fresh perspectives 
              to challenging projects and collaborative teams.
            </p>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
